import React from 'react';
import bars from "../assets/bar.png";

export default function BarGraph({width}) {
  return (
    <div>
        <img sizesstyle={{width:{width},height:"205px",marginLeft:"1rem",boxShadow: "rgba(0, 0, 0, 0.24) 0px 3px 8px",borderRadius: "0.5rem"}} src={bars} alt='bargraph'/>
    </div>
  )
}
